import React, { Component } from 'react';
import { bindActionCreators } from 'redux';
import { connect } from 'react-redux';
import { consumeApi } from '../actions'

class ConsumeApi extends Component {
    render() {
        return (
            <div>
                <div>
                    <h2>POST</h2>
                    <button className="post" onClick={this.props.consumeApi}>Send</button>
                </div>
                <div>
                    <h2>PUT</h2>
                    <button className="put">Send</button>
                </div>
                <hr/>
                <div>Method:{this.props.consumeApiReducer.method}</div>
            </div>
        );
    }
}

function mapStateToProps({ consumeApiReducer }) {
    return { consumeApiReducer };
}
function mapDispatchToProps(dispatch) {
    return bindActionCreators({ consumeApi }, dispatch);
}

export default connect(mapStateToProps, mapDispatchToProps)(ConsumeApi);
